import React, { useState } from "react";
import { Box, Typography } from "@material-ui/core";
import { useStyles } from "./HeaderStyle";
import Navbar from "./Navbar";
import { Decorator } from "../common/Common";
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
import DrawerComponent from "./DrawerComponent";
//import Typed from "react-typed";
import Typewriter from 'typewriter-effect/dist/core';


export default function Header() {
  const classes = useStyles();

  const [initialState, setInitialState] = useState(false);
  const handleDrawerToogler = () => {
    setInitialState(!initialState);
  };

  const navlinks = [
    { label: "About", Id: "About" },
    { label: "Works", Id: "Portfolio" },
    { label: "Comments", Id: "Comments" },
    { label: "Contact", Id: "Contact" },
  ];


  new Typewriter('#typewriter', {
  strings: [" I am a Webdeveloper,", "I am a UI/UX Designer,", " I am a Digital Expert,"],
  autoStart: true,
});
  return (
    <Box className={classes.HeardeWraper} id='Headder'>
      <Navbar navlinks={navlinks} handleDrawerToogler={handleDrawerToogler} />
      <DrawerComponent
        initialState={initialState}
        navlinks={navlinks}
        handleDrawerToogler={handleDrawerToogler}
      />

      <Box className={classes.Headercontaier}>
        <Typewriter onInit={(typewriter) => {typewriter
  .pauseFor(2500)
  .typeString('A simple yet powerful native javascript')
  .pauseFor(300)
  .deleteChars(10)
  .typeString('<strong>JS</strong> plugin for a cool typewriter effect and ')
  .typeString('<strong>only <span style="color: #27ae60;">5kb</span> Gzipped!</strong>')
  .pauseFor(1000)
  .start()}}
          
        
          
        />
          {/* I'm a Web developer<span style={{ paddingRight: "5px" }}></span> */}
          {/*<Typed
            strings={[" Webdeveloper,", " UI/UX Designer,", " Digital Expert,"]}
            typeSpeed={30}
            backSpeed={50}
            loop
          /> */}
        
        <Typography varinat='h3' component='h4' className={classes.headerDesc}>
          I Create Website And Application,
          <br />
          Based On Your Needs...
        </Typography>

        {Decorator({
          label: "About Us",
          withIcon: true,
          Icon: <ArrowDownwardIcon />,
        })}
      </Box>
    </Box>
  );
}
